ns2:primaryTypeAttribute.ns1:desc:
Distribution of the SINR difference for PUSCH between Uplink Coordinated Multi-Point Reception and Interference Rejection Combining within SectorCarrier.
				PDF ranges: 
				[0]: DeltaSINR <= -1; 
				[1]: -1<DeltaSINR <= 0; 
				[2]: 0 < DeltaSINR 2 <= 2; 
				[3]: 2 < DeltaSINR <= 4;  
				[4]: 2 < DeltaSINR <= 4; 
				[5]: 4 < DeltaSINR <= 6; 
				[6]: 6 < DeltaSINR <= 8; 
				[7]: 8 < DeltaSINR <= 10;
